import React from 'react'
import {Todo} from '../blueprints/todo'
import {ITodo} from '../blueprints/todo'
import TodoItem from './TodoItem'

const TodosCmp: React.FC<{items : ITodo[]}> = (props) => {
  return <ul>
    {props.items.map((item) => {
      return <TodoItem key={items.id} text={props.text}  />
    })}
  </ul>
}

export default TodosCmp;
